import React from 'react'
import styles from './style.module.css'
import { People } from './people';
import Person from './Person';

export default function Counter () { 

    return (
      <div>
         {
             People.map( (p) =>{
                 <Person name={p.name} age={p.age} image={p.image} />
             } )
         } 
      </div>
    )
}
